Variation (
Figs. 11
, 
12
).

Given the large sample size (25) across all ages classes and both sexes coupled with the ability of this species to change the intensity and boldness of is color pattern, dorsal color pattern characteristics vary considerably ranging from nearly unicolor gray-brown (
Fig. 11A
) to boldly contrasted patterns being offset by lightly colored areas (
Figs. 11B, D
). Other specimens have dorsal patterns that are more lightly colored overall and overlain with relatively faint, diffuse darker markings (
Figs. 11C, E
). The single hatchling had a nearly uniform gray dorsal coloration and pattern (
Fig. 11F
). Caudal pattern of original tails is especially variable, ranging from lightyellow to dull-white with bold, dark-colored bands (
Figs. 11B, D
) to having wide, faint, diffuse bands (
Fig.11C
) or thin, dark, dorsal, transverse markings (
Fig. 11E
). There are no consistent differences in color pattern variation between individuals from the Pinlaung City (n=20) population and those from the Wingabar Cave population (n=5). Variation in scales counts, mensural data, and additional minor aspects in coloration are presented in 
Table 11
.

Natural History.
During the evening from 1800–2400 hrs, we observed dozens of individuals on the cement and brick walls of nearly every building on the outskirts of the city but none in the surrounding upland forest (
Fig. 12
). Many of the females were gravid with two eggs and we also found hatchlings (SVL <
22 mm
). This indicates that November is within the reproductive season of this species. Given the small area of urban habitat through which we walked on our route to forested areas (~ 
0.5 km
), we suspect individuals of this species in Pinlaung City number well into the thousands if not more. We also observed several individuals on the following evening during the same hours on the walls of buildings and karst tower formations at Wingabar Cave (Fig. 13). Here too, we found gravid females but no hatchlings.
